import React, {useState} from 'react';
import {Space, Switch} from "antd";
import Title from "antd/es/typography/Title";

const Creator = () => {
    const [chek1, setChek1] = useState(false);
    const [chek2, setChek2] = useState(false);
    const onChange = (checked) => {
        setChek1(true)
        setChek2(false)
    };
    const onChangeу = (checked) => {
        setChek2(true)
        setChek1(false)
    };
    return (
        <Space style={{margin:40}} direction="vertical" >
            <Space>
                <Title level={4}>Студ Весна</Title>
                <Switch checked={chek1} onChange={onChange} />
            </Space>
            <Space>
                <Title style={{marginRight:30}} level={4}>Сон</Title>
                <Switch checked={chek2} onChange={onChangeу} />
            </Space>

        </Space>
    );
};

export default Creator;
